INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (1, 40011, 125801, 0, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 2, 321, 1, 24001, 1, "リリ");
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (2, 40011, 126001, 0, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 2, 322, 1, 24001, 1, "クリア");
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (3, 40011, 126101, 0, "んーと。\nこれ、あげる。\nはい", 2, 323, 1, 24001, 1, "プレシア");
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (4, 40011, 125801, 0, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, 324, 2, 24001, 1, "リリ");
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (5, 40011, 126001, 0, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 325, 2, 24001, 1, "クリア");
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (6, 40011, 126101, 0, "お兄。\nきてくれて、うれしい", 2, 326, 2, 24001, 1, "プレシア");
